import './App.css';
import Cabecalho from './Cabecalho';

function App() 
{
  return (
    <div className="App">

      <header className = "cabecalho">{Cabecalho()}</header>

      <div className = "mid">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </div>

      <div className= "bag">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </div>

    </div>
  );
}

export default App;
